import logo from './logo.svg';
import './App.css';
import './Home.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from './Home';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>

      <Routes>

        <Route path="." element={ <Home/> } />

      </Routes>

    </>
  );
}

export default App;
